import React from 'react';


function Hangman() {
    window.addEventListener("load", () => {
        const canvas = document.querySelector('#canvas');
        const ctx = canvas.getContext('2d');
        // // Staring point (10,45)
        // ctx.moveTo(10,130);
        // // End point (180,47)
        // ctx.lineTo(40,130);
        // // Make the line visible
        // ctx.stroke();
        firstMark(ctx);
    })

    return (
    <div className="App">
        <p>Hangman pic</p>
        <canvas id="canvas"></canvas>
    </div>
    );
}

function firstMark(ctx) {
    ctx.moveTo(10,130);
    ctx.lineTo(40,130);
    ctx.stroke();
}

export default Hangman;
